<h2>JD调研</h2>
<ol>
<li>
<p><a href="https://www.xiaoyuzhoufm.com/episode/680b04ea7a449ae85895ba00" target="_blank" rel="noopener noreferrer">34.与Fellou创始人谢扬的3小时访谈：孤独、95后、牌桌与生产力的完美创业 - 卫诗婕｜商业漫谈Jane's talk | 小宇宙 - 听播客，上小宇宙</a></p>
<blockquote>
<p>Fellou 的四大核心能力：深度行动、主动智能、影子空间、智能体网络</p>
